import { EXCHANGES } from '../data/exchanges';

const MAX_RETRIES = 3;
const RETRY_DELAY_MS = 1000; // 1 second

async function fetchWithRetry(url, retries = MAX_RETRIES) {
    try {
        const response = await fetch(url);
        if (!response.ok) {
            if (response.status === 429 && retries > 0) { // Too Many Requests - likely rate limiting
                console.warn(`Rate limited, retrying in ${RETRY_DELAY_MS / 1000} seconds... (${retries} retries left)`);
                await new Promise(resolve => setTimeout(resolve, RETRY_DELAY_MS));
                return fetchWithRetry(url, retries - 1);
            }
            throw new Error(`HTTP error! status: ${response.status}`);
        }
        return response;
    } catch (error) {
        if (retries > 0) {
            console.error(`Fetch failed (${error.message}), retrying in ${RETRY_DELAY_MS / 1000} seconds... (${retries} retries left)`);
            await new Promise(resolve => setTimeout(resolve, RETRY_DELAY_MS));
            return fetchWithRetry(url, retries - 1);
        }
        console.error(`Fetch failed after multiple retries: ${error.message}`);
        throw error; // Re-throw the error after all retries fail
    }
}

export async function fetchAllPrices() {
    const results = [];

    for (const exchange of EXCHANGES) {
        try {
            let data = null;
            let response;

            switch (exchange.name) {
                case 'Binance':
                    response = await fetchWithRetry(exchange.api + exchange.exampleSymbol);
                    const binanceJson = await response.json();
                    data = { symbol: exchange.exampleSymbol, price: parseFloat(binanceJson.price) };
                    break;

                case 'Coinbase':
                    // Implement proper price fetching for Coinbase
                    try {
                        response = await fetchWithRetry(exchange.api);
                        const coinbaseJson = await response.json();
                        const ticker = coinbaseJson.find(p => p.id === exchange.exampleSymbol);
                        if (ticker && ticker.price) { // Adjust based on actual Coinbase price field
                            data = { symbol: exchange.exampleSymbol, price: parseFloat(ticker.price) };
                        } else {
                            console.warn(`Could not find price for ${exchange.exampleSymbol} on Coinbase.`);
                        }
                    } catch (error) {
                        console.error(`Error fetching/parsing Coinbase data: ${error.message}`);
                    }
                    break;

                case 'Kraken':
                    response = await fetchWithRetry(exchange.api + exchange.exampleSymbol);
                    const krakenJson = await response.json();
                    if (krakenJson.result) {
                        const pair = Object.keys(krakenJson.result)[0];
                        const price = krakenJson.result[pair]?.c?.[0];
                        if (price) {
                            data = { symbol: exchange.exampleSymbol, price: parseFloat(price) };
                        }
                    }
                    break;

                case 'Bitfinex':
                    const bitfinexSymbol = 't' + exchange.exampleSymbol;
                    response = await fetchWithRetry(exchange.api + bitfinexSymbol);
                    const bitfinexJson = await response.json();
                    if (Array.isArray(bitfinexJson)) {
                        data = { symbol: exchange.exampleSymbol, price: parseFloat(bitfinexJson[6]) };
                    }
                    break;

                case 'Huobi':
                    response = await fetchWithRetry(exchange.api + exchange.exampleSymbol);
                    const huobiJson = await response.json();
                    if (huobiJson.tick) {
                        data = { symbol: exchange.exampleSymbol, price: huobiJson.tick.close };
                    }
                    break;

                case 'OKEx':
                    response = await fetchWithRetry(exchange.api + exchange.exampleSymbol);
                    const okexJson = await response.json();
                    if (okexJson.data && okexJson.data.length > 0) {
                        data = { symbol: exchange.exampleSymbol, price: parseFloat(okexJson.data[0].last) };
                    }
                    break;

                case 'Bittrex':
                    response = await fetchWithRetry(exchange.api + exchange.exampleSymbol + '/ticker');
                    const bittrexJson = await response.json();
                    if (bittrexJson.lastTradeRate) {
                        data = { symbol: exchange.exampleSymbol, price: parseFloat(bittrexJson.lastTradeRate) };
                    }
                    break;

                case 'Poloniex':
                    response = await fetchWithRetry(exchange.api);
                    const poloniexJson = await response.json();
                    const poloKey = exchange.exampleSymbol.replace('-', '_');
                    const poloPrice = poloniexJson[poloKey]?.last;
                    if (poloPrice) {
                        data = { symbol: exchange.exampleSymbol, price: parseFloat(poloPrice) };
                    }
                    break;

                case 'Gate.io':
                    response = await fetchWithRetry(exchange.api);
                    const gateioJson = await response.json();
                    if (gateioJson[exchange.exampleSymbol]) {
                        data = { symbol: exchange.exampleSymbol, price: parseFloat(gateioJson[exchange.exampleSymbol].last) };
                    }
                    break;

                case 'KuCoin':
                    response = await fetchWithRetry(exchange.api + exchange.exampleSymbol);
                    const kucoinJson = await response.json();
                    if (kucoinJson.code === '200' && kucoinJson.data) {
                        data = { symbol: exchange.exampleSymbol, price: parseFloat(kucoinJson.data.price) };
                    }
                    break;

                case 'Bitstamp':
                    response = await fetchWithRetry(exchange.api + exchange.exampleSymbol);
                    const bitstampJson = await response.json();
                    if (bitstampJson.last) {
                        data = { symbol: exchange.exampleSymbol, price: parseFloat(bitstampJson.last) };
                    }
                    break;

                case 'Gemini':
                    response = await fetchWithRetry(exchange.api + exchange.exampleSymbol);
                    const geminiJson = await response.json();
                    if (geminiJson.last) {
                        data = { symbol: exchange.exampleSymbol, price: parseFloat(geminiJson.last) };
                    }
                    break;

                case 'HitBTC':
                    response = await fetchWithRetry(exchange.api + exchange.exampleSymbol);
                    const hitbtcJson = await response.json();
                    if (hitbtcJson.last) {
                        data = { symbol: exchange.exampleSymbol, price: parseFloat(hitbtcJson.last) };
                    }
                    break;

                case 'CoinEx':
                    response = await fetchWithRetry(exchange.api + exchange.exampleSymbol);
                    const coinexJson = await response.json();
                    if (coinexJson.code === 0 && coinexJson.data?.ticker?.last) {
                        data = { symbol: exchange.exampleSymbol, price: parseFloat(coinexJson.data.ticker.last) };
                    }
                    break;

                case 'Bybit':
                    response = await fetchWithRetry(exchange.api + exchange.exampleSymbol);
                    const bybitJson = await response.json();
                    if (bybitJson.ret_code === 0 && bybitJson.result?.[0]?.last_price) {
                        data = { symbol: exchange.exampleSymbol, price: parseFloat(bybitJson.result[0].last_price) };
                    }
                    break;

                case 'FTX':
                    response = await fetchWithRetry(exchange.api);
                    const ftxJson = await response.json();
                    if (ftxJson.success && ftxJson.result) {
                        const market = ftxJson.result.find(m => m.name === exchange.exampleSymbol);
                        if (market?.price) {
                            data = { symbol: exchange.exampleSymbol, price: market.price };
                        }
                    }
                    break;

                case 'Deribit':
                    response = await fetchWithRetry(exchange.api + exchange.exampleSymbol);
                    const deribitJson = await response.json();
                    if (deribitJson.result?.last_price) {
                        data = { symbol: exchange.exampleSymbol, price: parseFloat(deribitJson.result.last_price) };
                    }
                    break;

                case 'BitMart':
                    response = await fetchWithRetry(exchange.api + exchange.exampleSymbol);
                    const bitmartJson = await response.json();
                    if (bitmartJson.data?.ticker?.last_price) {
                        data = { symbol: exchange.exampleSymbol, price: parseFloat(bitmartJson.data.ticker.last_price) };
                    }
                    break;

                case 'Liquid':
                    response = await fetchWithRetry(exchange.api);
                    const liquidJson = await response.json();
                    const liquidProduct = liquidJson.find(p => p.id === exchange.exampleSymbol);
                    if (liquidProduct?.last_traded_price) {
                        data = { symbol: exchange.exampleSymbol, price: parseFloat(liquidProduct.last_traded_price) };
                    }
                    break;

                case 'OKCoin':
                    response = await fetchWithRetry(exchange.api + exchange.exampleSymbol + '/ticker');
                    const okcoinJson = await response.json();
                    if (okcoinJson.data?.last) {
                        data = { symbol: exchange.exampleSymbol, price: parseFloat(okcoinJson.data.last) };
                    }
                    break;

                case 'ZB':
                    response = await fetchWithRetry(exchange.api + exchange.exampleSymbol);
                    const zbJson = await response.json();
                    if (zbJson.ticker?.last) {
                        data = { symbol: exchange.exampleSymbol, price: parseFloat(zbJson.ticker.last) };
                    }
                    break;

                case 'WazirX':
                    response = await fetchWithRetry(exchange.api);
                    const wazirxJson = await response.json();
                    if (wazirxJson[exchange.exampleSymbol.toLowerCase()]?.last) {
                        data = { symbol: exchange.exampleSymbol, price: parseFloat(wazirxJson[exchange.exampleSymbol.toLowerCase()].last) };
                    }
                    break;

                case 'BitFlyer':
                    response = await fetchWithRetry(exchange.api + exchange.exampleSymbol);
                    const bitflyerJson = await response.json();
                    if (bitflyerJson.ltp) {
                        data = { symbol: exchange.exampleSymbol, price: parseFloat(bitflyerJson.ltp) };
                    }
                    break;

                case 'Upbit':
                    response = await fetchWithRetry(exchange.api + exchange.exampleSymbol);
                    const upbitJson = await response.json();
                    if (Array.isArray(upbitJson) && upbitJson[0]?.trade_price) {
                        data = { symbol: exchange.exampleSymbol, price: parseFloat(upbitJson[0].trade_price) };
                    }
                    break;

                case 'Coincheck':
                    response = await fetchWithRetry(exchange.api);
                    const coincheckJson = await response.json();
                    if (coincheckJson.last) {
                        data = { symbol: 'BTC-JPY', price: parseFloat(coincheckJson.last) };
                    }
                    break;

                default:
                    data = null;
            }

            if (data?.price !== null) {
                results.push({ exchange: exchange.name, ...data });
            }
        } catch (error) {
            console.error(`Error fetching from ${exchange.name}: ${error.message}`);
            // Optionally, you could still push a null or error indicator into results
            // to indicate that fetching failed for this exchange.
            results.push({ exchange: exchange.name, symbol: exchange.exampleSymbol, price: null, error: error.message });
        }
    }

    return results;
}
